import React, { Component } from 'react';
import './App.css';

import Viewer from './pages/viewer';
import LoginPage from './pages/loginpage'

class App extends React.Component {

    render(){
        if (true)
            return {Viewer};
        else
            return {LoginPage};
    }
}

export default App;
